import React, { useState } from 'react';
import { Form, Button, Card, Alert } from 'react-bootstrap';
import { resumeAPI } from '../services/api';

const ResumeUpload = ({ onResumeUploaded }) => {
  const [formData, setFormData] = useState({
    candidateName: '', email: '', phone: '', skills: '', experience: '', education: ''
  });
  const [file, setFile] = useState(null);
  const [message, setMessage] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!file) {
      setMessage('Please select a resume file');
      return;
    }

    const data = new FormData();
    Object.keys(formData).forEach(key => data.append(key, formData[key]));
    data.append('resume', file);

    try {
      await resumeAPI.upload(data);
      setMessage('Resume uploaded successfully!');
      setFormData({ candidateName: '', email: '', phone: '', skills: '', experience: '', education: '' });
      setFile(null);
      onResumeUploaded?.();
    } catch (error) {
      setMessage('Error uploading resume');
    }
  };

  return (
    <Card>
      <Card.Header><h4>Upload Resume</h4></Card.Header>
      <Card.Body>
        {message && <Alert variant={message.includes('Error') ? 'danger' : 'success'}>{message}</Alert>}
        <Form onSubmit={handleSubmit}>
          <Form.Group className="mb-3">
            <Form.Label>Full Name</Form.Label>
            <Form.Control value={formData.candidateName} onChange={(e) => setFormData({...formData, candidateName: e.target.value})} required />
          </Form.Group>
          <Form.Group className="mb-3">
            <Form.Label>Email</Form.Label>
            <Form.Control type="email" value={formData.email} onChange={(e) => setFormData({...formData, email: e.target.value})} required />
          </Form.Group>
          <Form.Group className="mb-3">
            <Form.Label>Phone</Form.Label>
            <Form.Control value={formData.phone} onChange={(e) => setFormData({...formData, phone: e.target.value})} />
          </Form.Group>
          <Form.Group className="mb-3">
            <Form.Label>Skills (comma-separated)</Form.Label>
            <Form.Control value={formData.skills} onChange={(e) => setFormData({...formData, skills: e.target.value})} />
          </Form.Group>
          <Form.Group className="mb-3">
            <Form.Label>Experience</Form.Label>
            <Form.Control as="textarea" rows={2} value={formData.experience} onChange={(e) => setFormData({...formData, experience: e.target.value})} />
          </Form.Group>
          <Form.Group className="mb-3">
            <Form.Label>Education</Form.Label>
            <Form.Control value={formData.education} onChange={(e) => setFormData({...formData, education: e.target.value})} />
          </Form.Group>
          <Form.Group className="mb-3">
            <Form.Label>Resume File</Form.Label>
            <Form.Control type="file" accept=".pdf,.txt,.doc,.docx" onChange={(e) => setFile(e.target.files[0])} required />
          </Form.Group>
          <Button type="submit" variant="primary">Upload Resume</Button>
        </Form>
      </Card.Body>
    </Card>
  );
};

export default ResumeUpload;
